import React, { Component } from 'react';
import './main.css';

export default class Main extends Component {
    state = {
        titulo: "Game Fifteen",
        box: [],
        i: 15,
    };

    loadBox = () => {
        const { box } = this.state;
        for (box[i] = 1; box[i] <= 15; box[i]++)
            box[i] = i;
    }

    render() {
        const { titulo, box } = this.state;
        return (
            <div className="border">
                <h1>
                    {titulo}
                </h1>
                <div className="Box">
                    {box}
                </div>
            </div>
        )
    }
}
